(71, 174, 'Typography', 'typography', '<h3 class=\"jm-typo-title\">Animated hover CSS3 effects for images</h3>\r\n<p>This code allows you to display an image and its description with animated CSS3 effect.<br /><strong>Note:</strong> If you would like to add your own text into the image description, just modify the code below or edit an existing code in the custom module of the demo template.</p>\r\n<p> </p>\r\n<div class=\"clearfix\">\r\n<div style=\"width: 49%; float: left;\">\r\n<div>\r\n<p><strong>Example 1</strong></p>\r\n<div class=\"jm-code\" style=\"min-height: 165px;\">&lt;div class=\"ch-item ch-first\" style=\"background: url(\'<strong>images/modules/animated.jpg</strong>\') no-repeat;\"&gt; &lt;div class=\"ch-info\"&gt; &lt;div class=\"ch-container\"&gt; &lt;div class=\"ch-outer\"&gt; &lt;div class=\"ch-inner\"&gt; &lt;p&gt;&lt;a href=\"<strong>#link</strong>\"&gt;<strong>CHECK OUR</strong>&lt;br /&gt;&lt;span class=\"smaller\"&gt;<strong>NEW OFFER!</strong>&lt;/span&gt;&lt;/a&gt;&lt;/p&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt;</div>\r\n<p> </p>\r\n<div style=\"margin: 0 auto; width: 280px;\">\r\n<div class=\"ch-item ch-first\" style=\"background: url(\'images/modules/animated.jpg\') no-repeat;\">\r\n<div class=\"ch-info\">\r\n<div class=\"ch-container\">\r\n<div class=\"ch-outer\">\r\n<div class=\"ch-inner\">\r\n<p><a href=\"#\">CHECK OUR<br /><span class=\"smaller\">NEW OFFER!</span></a></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<p> </p>\r\n</div>\r\n<div style=\"width: 49%; float: right;\">\r\n<div>\r\n<p><strong>Example 2</strong></p>\r\n<div class=\"jm-code\" style=\"min-height: 165px;\">&lt;div class=\"ch-item ch-second\" style=\"background: url(\'<strong>images/modules/animated.jpg</strong>\') no-repeat;\"&gt; &lt;div class=\"ch-info-wrap\"&gt; &lt;div class=\"ch-info\"&gt; &lt;div class=\"ch-info-front\"&gt; &lt;/div&gt; &lt;div class=\"ch-info-back\"&gt; &lt;div class=\"ch-container\"&gt; &lt;div class=\"ch-outer\"&gt; &lt;div class=\"ch-inner\"&gt; &lt;p&gt;&lt;a href=\"<strong>#link</strong>\"&gt;<strong>CHECK OUR</strong>&lt;br /&gt;&lt;span class=\"smaller\"&gt;<strong>NEW OFFER!</strong>&lt;/span&gt;&lt;/a&gt;&lt;/p&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt;</div>\r\n<p> </p>\r\n<div style=\"margin: 0 auto; width: 280px;\">\r\n<div class=\"ch-item ch-second\" style=\"background: url(\'images/modules/animated.jpg\') no-repeat;\">\r\n<div class=\"ch-info-wrap\">\r\n<div class=\"ch-info\">\r\n<div class=\"ch-info-front\"> </div>\r\n<div class=\"ch-info-back\">\r\n<div class=\"ch-container\">\r\n<div class=\"ch-outer\">\r\n<div class=\"ch-inner\">\r\n<p><a href=\"#\">CHECK OUR<br /><span class=\"smaller\">NEW OFFER!</span></a></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<p> </p>\r\n</div>\r\n<div style=\"width: 49%; float: left;\">\r\n<div>\r\n<p><strong>Example 3</strong></p>\r\n<div class=\"jm-code\" style=\"min-height: 165px;\">&lt;div class=\"ch-item ch-third\"&gt; &lt;div class=\"ch-info\"&gt; &lt;div class=\"ch-info-front\" style=\"background: url(\'<strong>images/modules/animated.jpg</strong>\') no-repeat;\"&gt; &lt;/div&gt; &lt;div class=\"ch-info-back\"&gt; &lt;div class=\"ch-container\"&gt; &lt;div class=\"ch-outer\"&gt; &lt;div class=\"ch-inner\"&gt; &lt;p&gt;&lt;a href=\"<strong>#link</strong>\"&gt;<strong>CHECK OUR</strong>&lt;br /&gt;&lt;span class=\"smaller\"&gt;<strong>NEW OFFER!</strong>&lt;/span&gt;&lt;/a&gt;&lt;/p&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt;</div>\r\n<p> </p>\r\n<div style=\"margin: 0 auto; width: 280px;\">\r\n<div class=\"ch-item ch-third\">\r\n<div class=\"ch-info\">\r\n<div class=\"ch-info-front\" style=\"background: url(\'images/modules/animated.jpg\') no-repeat;\"> </div>\r\n<div class=\"ch-info-back\">\r\n<div class=\"ch-container\">\r\n<div class=\"ch-outer\">\r\n<