(84, 206, 'All Template\'s Positions', 'all-template-positions', '<p><strong>JM Cleaning Company</strong> Joomla template is using fully responsive layout that adjusts to various screens: desktops, tablets or mobiles.<br /><a title=\"EF4 Framework\" href=\"http://www.joomla-monster.com/index.php?option=com_content&amp;id=137&amp;view=category&amp;Itemid=548\" target=\"_blank\">EF4 Framework</a> includes <a title=\"Layout Builder\" href=\"http://www.joomla-monster.com/index.php?option=com_content&amp;catid=137&amp;id=901&amp;view=article&amp;Itemid=1034\" target=\"_blank\">Layout Builder</a> tool which allows you to customize template layout for different screen dimensions.</p>\r\n', '\r\n<p></p>\r\n<h3 style=\"text-align: center;\">Module positions for normal and large screen <small>usually desktop and tablet landscape (980px and higher)</small></h3>\r\n<p></p>\r\n<p style=\"text-align: center;\"><a title=\"Layout Builder\" href=\"http://www.joomla-monster.com/index.php?option=com_content&amp;catid=137&amp;id=901&amp;view=article&amp;Itemid=1034\" target=\"_blank\"><img title=\"Module positions for normal and large screen\" src=\"images/features/normal-positions.jpg\" alt=\"Module positions for normal and large screen\" border=\"0\" /></a></p>\r\n<p style=\"text-align: center;\"><a class=\"btn\" title=\"Layout Builder\" href=\"http://www.joomla-monster.com/index.php?option=com_content&amp;catid=137&amp;id=901&amp;view=article&amp;Itemid=1034\" target=\"_blank\">Check out more details about layout customization!</a></p>\r\n<p></p>\r\n<h3 style=\"text-align: center;\">Module positions for medium screen <small>usually tablet (768px-979px)</small></h3>\r\n<p></p>\r\n<p style=\"text-align: center;\"><a title=\"Layout Builder\" href=\"http://www.joomla-monster.com/index.php?option=com_content&amp;catid=137&amp;id=901&amp;view=article&amp;Itemid=1034\" target=\"_blank\"><img title=\"Module positions for medium screen\" src=\"images/features/medium-positions.jpg\" alt=\"Module positions for medium screen\" border=\"0\" /></a></p>\r\n<p style=\"text-align: center;\"><a class=\"btn\" title=\"Layout Builder\" href=\"http://www.joomla-monster.com/index.php?option=com_content&amp;catid=137&amp;id=901&amp;view=article&amp;Itemid=1034\" target=\"_blank\">Check out more details about layout customization!</a></p>\r\n<p></p>\r\n<h3 style=\"text-align: center;\">Module positions for small screen <small>usually tablet portrait and mobile landscape (481px-767px)</small></h3>\r\n<p></p>\r\n<p style=\"text-align: center;\"><a title=\"Layout Builder\" href=\"http://www.joomla-monster.com/index.php?option=com_content&amp;catid=137&amp;id=901&amp;view=article&amp;Itemid=1034\" target=\"_blank\"><img title=\"Module positions for small screen\" src=\"images/features/small-positions.jpg\" alt=\"Module positions for small screen\" border=\"0\" /></a></p>\r\n<p style=\"text-align: center;\"><a class=\"btn\" title=\"Layout Builder\" href=\"http://www.joomla-monster.com/index.php?option=com_content&amp;catid=137&amp;id=901&amp;view=article&amp;Itemid=1034\" target=\"_blank\">Check out more details about layout customization!</a></p>\r\n<p></p>\r\n<h3 style=\"text-align: center;\">Module positions for extra small screen <small>usually mobile portrait (480px and smaller)</small></h3>\r\n<p></p>\r\n<p style=\"text-align: center;\"><a title=\"Layout Builder\" href=\"http://www.joomla-monster.com/index.php?option=com_content&amp;catid=137&amp;id=901&amp;view=article&amp;Itemid=1034\" target=\"_blank\"><img title=\"Module positions for extra small screen\" src=\"images/features/extrasmall-positions.jpg\" alt=\"Module positions for extra small screen\" border=\"0\" /></a></p>\r\n<p style=\"text-align: center;\"><a class=\"btn\" title=\"Layout Builder\" href=\"http://www.joomla-monster.com/index.php?option=com_content&amp;catid=137&amp;id=901&amp;view=article&amp;Itemid=1034\" target=\"_blank\">Check out more details about layout customization!</a></p>', -2, 82, '2013-11-19 09:38:06', 618, '', '2015-05-06 11:43:50', 545, 0, '0000-00-00 00:00:00', '2013-11-19 09:38:06', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 7, 7, '', '', 1, 20, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', ''),
(85, 207, 'Module Suffixes', 'module-suffixes', '<p>There are several available module designs that you can control by entering the correct suffix name to a module parameter.<br /> Let\'s check them all.</p>\r\n', '\r\n<p><br />1. Available module designs.</p>\r\n<p><img class=\"border_img\" title=\"Module designs\" src=\"images/features/module-suffixes.png\" alt=\"module-suffixes\" border=\"0\" /></p>\r\n<p><br />2. Use the suffix for Joomla Search module if you want to get the following view. Otherwise the module will use the default css styles.</p>\r\n<p><br /><img class=\"border_img\" src=\"images/features/search-ms.png\" alt=\"\" border=\"0\" /></p>\r\n<p><br /><strong>Suffix name:</strong> search-ms</p>\r\n<p><br />3. Use the suffix for menu module if you want to get the following view. Otherwise the module will use the default css styles.</p>\r\n<p><br /><img class=\"border_img\" src=\"images/features/tag-ms.png\" alt=\"\" border=\"0\" /></p>\r\n<p><br /><strong>Suffix name:</strong> tag-ms</p>\r\n<p><br />5. Use the suffix for module if you want to remove default bottom margin.</p>\r\n<p><br /><strong>Suffix name:</strong> margin-ms</p>\r\n<p><br />6. Additional and very useful suffix to make your modules height the same.<br />You just have to put a suffix at a module configuration to get the specified module height. <br /><br />See here the screenshot:</p>\r\n<p><img class=\"border_img\" title=\"Module height\" src=\"images/features/height1.jpg\" alt=\"height1\" border=\"0\" /></p>\r\n<p><strong>_mod300</strong> means that your module will be of 300 pixels high.<br /><br />If you need to mix suffixes, remember to put that suffix at the end and add space between suffixes, see the example:</p>\r\n<p><img src=\"images/features/height2.jpg\" alt=\"height2\" border=\"0\" /><br /><br /></p>', -2, 82, '2013-11-19 09:39:13', 618, '', '2015-05-07 08:51:04', 545, 0, '0000-00-00 00:00:00', '2013-11-19 09:39:13', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 19, 8, '', '', 1, 42, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', ''),
