(128, 437, 'Requisitos de Acesso e Saídas', 'requisitos-de-acesso-e-saidas', '<h3>Requisitos de Acesso ao ADR</h3>\r\n<p>Carta de condução definitiva, de acordo com o D.L. n.º 44/2005 de 23 de Fevereiro.\r\n</p>\r\n\r\n\r\n\r\n<h3>Obrigações e Isenções do ADR.</h3>\r\n<p>Existem algumas isenções á obrigatoriedade do certificado de Transporte de Mercadorias Perigosas (carta ADR).\r\n</p>\r\n<p>Para uma percepção mais simples o quadro abaixo, ilustra alguns dos limites (não dispensa a consulta da legislação em vigor):\r\n</p>\r\n<table>\r\n  <tr>\r\n    <th colspan=\"3\">Outras Matérias</th>\r\n    <th colspan=\"2\">Gasóleo</th>\r\n  </tr>\r\n  <tr>\r\n    <td></td>\r\n    <td>Gás</td>\r\n    <td>Outros</td>\r\n	<td>GRG</td>\r\n	<td>Cisternas</td>\r\n  </tr>\r\n   <tr>\r\n    <td>ADR Base</td>\r\n    <td> Isento até 333 Kg; <p> Obrigatório a partir de 333 Kg </p> </td>\r\n    <td>Dependendo da categoria transporte</td>\r\n	<td>Isento até 1000 Litros\r\n<p>Obrigatório a partir de 1000 Litros</p> </td>\r\n	<td>Obrigatório</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Cisternas</td>\r\n    <td> Isento (para transporte em garrafas) </td>\r\n    <td>Dependendo da categoria transporte</td>\r\n	<td>N.A</td>\r\n	<td>Obrigatório</td>\r\n  </tr>\r\n</table>\r\n\r\n<h3> Documentos Necessários à emissão do ADR:</h3>\r\n<p></p>\r\n<ul>\r\n<li>Cópia da Carta de Condução</i>\r\n<li>Cópia da Carta de Condução</i>\r\n<li>Cópia da Carta de Condução</i>\r\n<li>Cópia da Carta de Condução</i>\r\n<li>Cópia da Carta de Condução</i>\r\n<li>Cópia da Carta de Condução</i>\r\n<li>Cópia da Carta de Condução</i>\r\n</ul>\r\n\r\n', '', 1, 82, '2017-05-15 15:55:44', 618, '', '2017-05-15 16:08:17', 618, 0, '0000-00-00 00:00:00', '2017-05-15 15:55:44', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 2, 0, '', '', 1, 11, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '');
