INSERT INTO `w2auh_jumi` (`id`, `title`, `alias`, `path`, `custom_script`, `access`, `checked_out`, `published`) VALUES
(1, 'Hello Jumi!', 'hello-jumi', '', '<!-- Jumi intro including some php code (sitename, username) - see below. -->\r\n\r\n<?php\r\nfunction sitename() { //gets sitename\r\n $config = new JConfig();\r\n return $config->sitename;\r\n}\r\n$user = JFactory::getUser(); //gets user object\r\n?>\r\n\r\n<h3>Hello in the world of Jumi!</h3>\r\n<p>Jumi is a set of Joomla! extensions enabling to include custom codes (html, php, css, js, ...) into Joomla!</p>\r\n<ul>\r\n<li>Jumi <b>module</b> includes codes into Joomla! module positions,</li>\r\n<li>Jumi <b>plugin</b> includes codes into Joomla! articles,</li>\r\n<li>Jumi <b>component</b> creates separate Joomla! components from custom codes.</li>\r\n</ul>\r\n<p>We hope Jumi will be useful for your <strong><?php echo sitename(); ?></strong> site. As it is for more then 400.000 other webmasters and developers.<p>\r\n<h4>Jumi resources</h4>\r\n<p>You can also visit following resources for Jumi native extensions for Joomla! 1.5.x, 2.5.x ans 3.0.x:</p>\r\n<ul>\r\n<li><a href=\"http://2glux.com/projects/jumi\" title=\"Jumi downloads\">Jumi downloads</a>,</li>\r\n<li><a href=\"http://2glux.com/projects/jumi/concise-guide\" title=\"Concise guide\">Jumi concise guide</a>,</li>\r\n<li><a href=\"http://2glux.com/projects/jumi/tutorial\" title=\"Jumi Tips, tricks, snippet\">Jumi tips, tricks and snippets</a>,</li>\r\n<li>Jumi support can be found at <a href=\"http://2glux.com/forum/jumi/\" title=\"Jumi support\">Jumi support forum</a>,</li>\r\n<li><a href=\"http://extensions.joomla.org/extensions/edition/custom-code-in-content/1023/\" title=\"Jumi feedbacks and opinions\">Jumi feedbacks and opinions</a>.</li>\r\n</ul>\r\n<p>Dear \r\n<?php\r\nif ($user->name == \'\')\r\n echo \"unknown, not logged, friend\";\r\nelse\r\n echo $user->name;\r\n?>\r\n!<br />Have a nice day, weeks, months and years with Jumi!\r\n<br />\r\nWhat next? Try <a href=\"index.php?option=com_jumi&fileid=2\">Joomla!-Jumi blogspot component</a> in your pages now!\r\n</p>', 0, 0, 1),
(2, 'Blogspot', 'blogspot', 'components/com_jumi/files/blogger.php', '<?php\r\n//Display joomla-jumi.blogspot.com\r\n//You can change following variables so you can display your own blog.\r\n$blogId = \'1748567850225926498\';\r\n$login = \'joomla-jumi\';\r\n$cacheTime = 86400;\r\n?>', 0, 0, 1),
(3, 'Teste_1', '', 'components/com_jumi/files/facebook-class/feeds.php', '<?php\r\n# New Timeline\r\n$tl = new timeline (\r\n\'academiadoprofissional\', // username or id\r\n\'28f7b3704463fbeaa0f694442ebdd703\', // facebook tokenId\r\n\'9b2bcd5e773eeccb9c84ec44575a8486\' // facebook tokenSecret\r\n);\r\n$tl->setMaxItems(4); //How many items (Don\'t use to many. preferred 30,40 or 50)\r\n$tl->setNewsType(\'posts\'); //Feed or Posts\r\n$tl->setNewsFilter(true); //Filter only posts if it contains text (so no status updates)\r\n$tl->setShowImages(true); //Show images on posts\r\n$tl->setHrImages(true); //Higher resolution images ? Lazy loading will prevent slowing down your website\r\n$tl->setShowComments(true); //Show Comments\r\n$tl->setMaxComments(10); //Maximum comments to show (Don\'t use to many. preferred 10)\r\n$tl->setCacheLife(21600); //Cache life in seconds. Cache is disabled when set to \"0\".\r\n$tl->setCacheDirectory(\'./facebook/cache/\'); //cache directory\r\n$tl->setBullets(false); //Show bullets and timeline stripe divider\r\n# Language\r\n$lang = new language(); //Here you translation\r\n$lang->setTitle(\'NEWS\');\r\n$lang->setShareOnTwitter(\'Share on Twitter\');\r\n$lang->setShareOnLinkedIn(\'Share on LinkedIn\');\r\n$lang->setshareOnFacebook(\'Share on Facebook\');\r\n$lang->setShareOnGooglePlus(\'Share on Google+\');\r\n$lang->setComment(\'Comment or like !\');\r\n$lang->setShowComments(\'Show comments\');\r\n$lang->setBy(\'by\');\r\n$lang->setDatePrefix(\'\');\r\n$lang->setSecondsAgo(\' seconds ago\');\r\n$lang->setMinuteAgo(\' minute ago\');\r\n$lang->setMinutesAgo(\' minutes ago\');\r\n$lang->setHourAgo(\' hour ago\');\r\n$lang->setHoursAgo(\' hours ago\');\r\n$lang->setDayAgo(\' day ago\');\r\n$lang->setDaysAgo(\' days ago\');\r\n$lang->setWeekAgo(\' week ago\');\r\n$lang->setWeeksAgo(\' weeks ago\');\r\n\r\n?>\r\n', 0, 0, 1),
